import { Link } from "react-router-dom";
import GymBag1 from "../GymBagImages/GymBag1.jpg";
import CasualBag1 from "../CasualBagImages/CasualBag1.jpg";
import yutk_bag1 from "../DayPackImages/yutk_bag1.JPG";
import FannyPack1 from "../FannyPackImages/FannyPack1.jpg";

function AllBags() {
  return (
    <div className="zipper">
      <Link to="/gymbag">
        <img className="bag-image" src={GymBag1} alt="Gym Bag" />
      </Link>
      <Link to="/casualbag">
        <img className="bag-image" src={CasualBag1} alt="Casual Bag" />
      </Link>
      <Link to="/daypack">
        <img className="bag-image" src={yutk_bag1} alt="Day Pack" />
      </Link>
      <Link to="/fannypack">
        <img className="bag-image" src={FannyPack1} alt="Fanny Pack" />
      </Link>
    </div>
  );
}

export default AllBags;
